import{_ as e,c as a,o as i,d as t}from"./app.a06b8421.js";const n="/assets/thinkactive_cloud_devices.9863ae51.png",s="/assets/thinkactive_cloud_device.2907b0b9.png",_=JSON.parse('{"title":"Devices","description":"","frontmatter":{},"headers":[{"level":2,"title":"Managing Devices","slug":"managing-devices","link":"#managing-devices","children":[]},{"level":2,"title":"Understanding your Device data","slug":"understanding-your-device-data","link":"#understanding-your-device-data","children":[]}],"relativePath":"docs/thinkactive-cloud/devices.md","lastUpdated":1663606568000}'),d={name:"docs/thinkactive-cloud/devices.md"},c=t('<h1 id="devices" tabindex="-1">Devices <a class="header-anchor" href="#devices" aria-hidden="true">#</a></h1><p>The devices view allows you to view all devices registered in your organisation.</p><p><img src="'+n+'" alt="ThinkActive Cloud Devices"></p><h2 id="managing-devices" tabindex="-1">Managing Devices <a class="header-anchor" href="#managing-devices" aria-hidden="true">#</a></h2><p>Devices are registered with ThinkActive Cloud on first use there is no need to manually register them.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Note that using a device with ThinkActive Cloud registers it with your organisation. This counts towards your device credits.</p><p>Once devices are added they cannot be removed from your organisation.</p></div><p>You can search for devices by their serial, sort devices by last synced and more.</p><h2 id="understanding-your-device-data" tabindex="-1">Understanding your Device data <a class="header-anchor" href="#understanding-your-device-data" aria-hidden="true">#</a></h2><p><img src="'+s+'" alt="ThinkActive Cloud Device"></p><p>When selecting a device you can see all the information currently recorded about a device. Including last sync time, device serial, device type and more.</p><p>In the device data section you can see data from each of the sensors on the device. At the top of this section you can retrieve data by selecting a date range and an aggregate window (daily, hourly, RAW).</p><p>When viewing data in aggregate modes you can see several aggregate measures such as standard deviation, min and max values in the aggregate window you have chosen. You can drill down in greater detail by selecting specific days for analysis.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>At present you can only view RAW data on daily views.</p></div><p>Each sensor on the type of device selected shown in its own chart. Each sensor is described under the chart title.</p><p>You can also export the data you are currently viewing at any time by clicking &quot;Export CSV&quot;.</p>',15),o=[c];function r(l,h,v,u,g,p){return i(),a("div",null,o)}const m=e(d,[["render",r]]);export{_ as __pageData,m as default};
